Ms. ownership inscription of the Monastery of San Giorgio Maggiore: &quot;Est S[anc]ti Georgij Maioris Ven[etiarum]&quot;
The Monastery of San Giorgio was established in 982, when the Benedictine  monk, Giovanni Morosini  asked the doge Tribuno Memmo to donate the whole island of San Giorgio Maggiore (in Venice) for a Monastery. Morosini drained the island's marshes next to the church to get the ground for building, and founded the Monastery of San Giorgio Maggiore, and became its first abbot. In the early 19th century, after the Republic fell, the monastery was almost suppressed and the island became a free port with a new harbour built in 1812. It became the home of Venice's artillery. It is now the headquarters of the Cini Foundation arts centre, known for its library and is also home to the Teatro Verde open-air theatre.

 <a href="http://lccn.loc.gov/n84094570" rel="nofollow">San Giorgio maggiore (Monastery : Venice, Italy)</a>

